import React from 'react';

function NavBar(){
    return(
        <>
            <a href="#">Bad bank</a>
            <a href="#/CreateAccount/">Create Account</a>
            <a href="#/deposit/">Deposit</a>
            <a href="#/dithdraw/">Withdraw</a>
            <a href="#/alldata/">All Data</a>
        </>
    );
}
export default NavBar;
